INSERT INTO "foods" ("id","name","description","price","image","restaurant","restaurantName","qualification") VALUES (1,'Chupe de camarones','Este es uno de los platos típicos de Arequipa y uno de los más servidos en las picanterías de esta ciudad. Es una sopa picante que combina entre sus ingredientes: camarones de río, papa amarilla, queso, leche, maíces y un aderezo de ají y huacatay que le da un sabor auténtico. Ideal para personas que disfrutan lo picante y son amantes de los camarones. ',15.0,'https://blog.casa-andina.com/wp-content/uploads/2020/10/Chupe-de-camarones-El-Comercio.jpg',1,'Dimas','4.0');
INSERT INTO "foods" ("id","name","description","price","image","restaurant","restaurantName","qualification") VALUES (2,'Rocoto relleno','Este es uno de los platos banderas de la Ciudad Blanca, que incluso ha logrado traspasar fronteras gracias a su exquisito sabor. Da honor a su nombre ya que su propuesta incluye un rocoto relleno de carne molida mezclada con guisantes, aceitunas, queso fresco y otras especies que hacen de éste un plato de sabor inigualable. Suele ir acompañado de pastel de papa, lo que provoca una combinación que te enamorará por completo. ',10.0,'https://blog.casa-andina.com/wp-content/uploads/2020/10/Rocoto-relleno-La-Plaza-Bar-Grill-Arequipa.jpg',1,'Dimas','5.0');
